import axios from 'axios';
import SearchBar from './SearchBar';


class App extends React.Component {
    state = {
        term: '' 
    }
    onFormSubmit = (term) => {
        axios.get();
    }
    render() {
        return (
            <div className="ui container" style={{marginTop: '10px'}}><SearchBar myOnSubmit={this.onFormSubmit}/></div>
        )

    }
};

export default App;
